class Submission:
    def __init__(self, data):
        self.data = data
        self.status = "Pending"

    def validate(self):
        # Simulated validation logic
        return bool(self.data)

    def update_status(self, new_status):
        self.status = new_status

class Dashboard:
    def __init__(self):
        self.submissions = []

    def add_submission(self, submission):
        if submission.validate():
            self.submissions.append(submission)
            submission.update_status("Submitted")
        else:
            raise ValueError("Submission data is invalid.")

    def get_status_labels(self):
        return {submission.data: submission.status for submission in self.submissions}

class FileHandler:
    supported_file_types = ['.txt', '.pdf', '.docx']

    @staticmethod
    def validate_file_extension(file_name):
        return any(file_name.endswith(ext) for ext in FileHandler.supported_file_types)

    @staticmethod
    def upload_file(file_name):
        if FileHandler.validate_file_extension(file_name):
            print(f"File {file_name} uploaded successfully.")
        else:
            raise ValueError("Unsupported file type.")

class Logger:
    @staticmethod
    def log_error(message):
        print(f"ERROR: {message}")

class FABSController:
    def __init__(self, dashboard):
        self.dashboard = dashboard

    def submit(self, submission):
        if submission.validate():
            self.dashboard.add_submission(submission)
            print("Submission added to dashboard.")
        else:
            Logger.log_error("Invalid submission data.")

